import React, { useState } from "react";
import { Modal, Form, Input, InputNumber } from "antd";

const CustomModal = ({
  visible,
  onCancel,
  onhandleAdd,
  editData,
  editOneData,
  editSecondData,
  editThirdData,
  editFourthData
}) => {
  const [newdata, setNewData] = useState({
    editOneData: this.initialValues.name,
    editSecondData,
    editThirdData,
    editFourthData
  });
  return (
    <Modal centered closable={false} visible={visible} onCancel={onCancel}>
      <Form
        onFinish={onhandleAdd(newdata)}
        hideRequiredMark={true}
        initialValues={{
          name: editOneData,
          price: editSecondData,
          type: editThirdData,
          date: editFourthData
        }}
      >
        <Form.Item
          label="Name"
          name="name"
          rules={[
            {
              required: true,
              message: "Please input  name!"
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="Price"
          name="price"
          rules={[
            {
              required: true,
              message: "Please input price!"
            }
          ]}
        >
          <InputNumber />
        </Form.Item>
        <Form.Item
          label="Type"
          name="type"
          rules={[
            {
              required: true,
              message: "Please input type!"
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="Date"
          name="date"
          rules={[
            {
              required: true,
              message: "Please input date!"
            }
          ]}
        >
          <Input />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default CustomModal;
